import React from 'react';

const WelcomePage = () => {
    return (
        <div style={{ padding: '2rem', textAlign: 'center' }}>
            <h1>Welcome to InternGo!</h1>
            <p>Your journey to finding the perfect internship starts here.</p>
        </div>
    );
};

export default WelcomePage;
